import './Marvel.css';

function Marvel(props) {
    return (
        <div className="marvel-card">
            <div className="name">"Name: "{props.name}</div>
            <div className="Universe">{props.Universe} </div>
            <div className="Universe">{props.alter_ego} </div>
            <div className="Universe">{props.who} </div>
            <div className="Universe">{props.friends} </div>
            <div className="Universe">{props.power} </div>
            <img className="marvel_photo" src={props.photo} />
            <div className="Universe">{props.description} </div>
        </div>
    );
}

export default Marvel;
